<html xmlns:v="urn:schemas-microsoft-com:vml">
<head>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<style>
v\:* { behavior: url(#default#VML); }
.userData {behavior:url(#default#userdata);}
</style>
<link rel=stylesheet href="../css/chart.css">
<script>
function _Com_GetUrlParameter(param){
	var url = location.href;
	var re = new RegExp();
	re.compile("[\\?&]"+param+"=([^&]*)", "i");
	var arr = re.exec(url);
	if(arr==null)
		return null;
	else
		return decodeURIComponent(arr[1]);
}
var qdomain = _Com_GetUrlParameter("domain");
if (qdomain != null && qdomain != '') {
	document.domain = qdomain;
}
</script>
<script>
	var Com_Parameter = {
		ContextPath : parent.Com_Parameter.ContextPath,
		ResPath : parent.Com_Parameter.ResPath,
		Style : parent.Com_Parameter.Style,
		StylePath : parent.Com_Parameter.StylePath,
		Cache: parent.Com_Parameter.Cache,
		IE:(typeof window.ActiveXObject!="undefined")
	};
	Data_XMLCatche = parent.Data_XMLCatche;
</script>
<script src=../js/panel.js></script>
<script src=../js/drawer_vml.js></script>
</head>
<body topmargin=0 leftmargin=0 onload="FlowChartObject.Initialize();" style="min-height:380px;">
<v:shapetype id="diamond" coordsize="2 2">
    <v:path v="m 1,0 l 2,1,1,2,0,1,1,0 x e" />
</v:shapetype>
<v:shapetype id="split" coordsize="120 20">
    <v:path v="m 0,5 l 5,0,115,0,120,5,120,20,0,20,0,5 x e" />
</v:shapetype>
<v:shapetype id="join" coordsize="120 20">
    <v:path v="m 0,0 l 120,0,120,15,115,20,5,20,0,15,0,0 x e" />
</v:shapetype>
<v:shapetype id="cross" coordsize="5 5">
    <v:path v="m 0,2 l 2,2 2,0 3,0 3,2 5,2 5,3 3,3 3,5 2,5 2,3 0,3 0,2 x e" />
</v:shapetype>
<div id="clipboardData" class="userData"></div>
</body>
</html>
